// src/components/Register.js
import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";
import {
  Container,
  Typography,
  TextField,
  Button,
  Box,
  Alert,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Checkbox,
  FormControlLabel,
  Fade,
} from "@mui/material";
import { styled } from "@mui/system";

const StyledContainer = styled(Container)(({ theme }) => ({
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
  minHeight: "100vh",
  background: "linear-gradient(135deg, #f5f7fa, #c3cfe2)",
  padding: theme.spacing(4),
}));

const StyledForm = styled(Box)(({ theme }) => ({
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
  boxShadow: theme.shadows[10],
  padding: theme.spacing(4),
  width: "100%",
  maxWidth: "600px",
  textAlign: "center",
  transition: "transform 0.3s ease-in-out",
  "&:hover": {
    transform: "scale(1.02)",
  },
}));

const StyledButton = styled(Button)(({ theme }) => ({
  background: "linear-gradient(45deg, #00a400, #00c853)",
  color: theme.palette.common.white,
  fontWeight: "bold",
  padding: theme.spacing(1.5),
  "&:hover": {
    background: "linear-gradient(45deg, #00c853, #00a400)",
  },
}));

const Register = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    confirmPassword: "",
    birthDay: "",
    birthMonth: "",
    birthYear: "",
    agreeTerms: false,
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, checked, type } = e.target;
    setFormData({
      ...formData,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      setError("As senhas não coincidem.");
      return;
    }
    if (!formData.agreeTerms) {
      setError("Você deve concordar com os termos e políticas.");
      return;
    }

    setLoading(true);
    setError("");
    setSuccess("");

    try {
      const response = await axios.post("http://localhost:8000/api/register/", {
        username: formData.email,
        email: formData.email,
        password: formData.password,
        first_name: formData.firstName,
        last_name: formData.lastName,
        birth_date: `${formData.birthYear}-${formData.birthMonth}-${formData.birthDay}`,
      });
      console.log("Usuário registrado:", response.data);
      setSuccess(
        "Registro realizado com sucesso! Redirecionando para o login..."
      );
      setTimeout(() => {
        navigate("/login");
      }, 2000);
    } catch (err) {
      setError(err.response?.data?.message || "Erro ao registrar usuário.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <StyledContainer>
      {/* Cabeçalho */}
      <Typography
        variant="h2"
        component="h1"
        sx={{
          fontFamily: "Poppins, sans-serif",
          fontWeight: 600,
          color: "#00a400",
          mb: 4,
        }}
      >
        Trinar
      </Typography>

      {/* Formulário */}
      <StyledForm>
        <Typography variant="h5" component="h2" gutterBottom>
          Crie uma conta
        </Typography>
        <Typography variant="subtitle1" color="textSecondary" gutterBottom>
          É rápido e fácil.
        </Typography>

        {/* Mensagens de erro e sucesso */}
        {error && (
          <Fade in={!!error}>
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          </Fade>
        )}
        {success && (
          <Fade in={!!success}>
            <Alert severity="success" sx={{ mb: 2 }}>
              {success}
            </Alert>
          </Fade>
        )}

        {/* Campos do Formulário */}
        <Box component="form" onSubmit={handleSubmit}>
          {/* Nome e Sobrenome */}
          <Box sx={{ display: "flex", gap: 2, mb: 2 }}>
            <TextField
              fullWidth
              label="Nome"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              label="Sobrenome"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              required
            />
          </Box>

          {/* Data de Nascimento */}
          <Typography variant="subtitle2" sx={{ mb: 1 }}>
            Data de Nascimento
          </Typography>
          <Box sx={{ display: "flex", gap: 2, mb: 2 }}>
            <TextField
              fullWidth
              label="Dia"
              name="birthDay"
              value={formData.birthDay}
              onChange={handleChange}
              type="number"
              inputProps={{ min: 1, max: 31 }}
              required
            />
            <FormControl fullWidth>
              <InputLabel>Mês</InputLabel>
              <Select
                name="birthMonth"
                value={formData.birthMonth}
                onChange={handleChange}
                label="Mês"
                required
              >
                {Array.from({ length: 12 }, (_, i) => (
                  <MenuItem key={i + 1} value={(i + 1).toString().padStart(2, "0")}>
                    {new Date(0, i).toLocaleString("default", { month: "long" })}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            <TextField
              fullWidth
              label="Ano"
              name="birthYear"
              value={formData.birthYear}
              onChange={handleChange}
              type="number"
              inputProps={{ min: 1900, max: new Date().getFullYear() }}
              required
            />
          </Box>

          {/* Email */}
          <TextField
            fullWidth
            label="Email"
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            sx={{ mb: 2 }}
          />

          {/* Senha e Confirmar Senha */}
          <TextField
            fullWidth
            label="Senha"
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
            sx={{ mb: 2 }}
          />
          <TextField
            fullWidth
            label="Confirmar Senha"
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
            sx={{ mb: 2 }}
          />

          {/* Termos e Políticas */}
          <FormControlLabel
            control={
              <Checkbox
                name="agreeTerms"
                checked={formData.agreeTerms}
                onChange={handleChange}
                required
              />
            }
            label={
              <Typography variant="body2">
                Concordo com os{" "}
                <Link to="/terms" style={{ color: "#00a400", textDecoration: "none" }}>
                  Termos de Serviço
                </Link>
                ,{" "}
                <Link to="/privacy" style={{ color: "#00a400", textDecoration: "none" }}>
                  Política de Privacidade
                </Link>
                {" e "}
                <Link to="/cookies" style={{ color: "#00a400", textDecoration: "none" }}>
                  Política de Cookies
                </Link>
                .
              </Typography>
            }
            sx={{ mb: 2 }}
          />

          {/* Botão de Cadastro */}
          <StyledButton fullWidth type="submit" disabled={loading}>
            {loading ? "Cadastrando..." : "Cadastre-se"}
          </StyledButton>

          {/* Link para o Login */}
          <Typography variant="body2" sx={{ mt: 2 }}>
            Já tem uma conta?{" "}
            <Link to="/login" style={{ color: "#00a400", textDecoration: "none" }}>
              Faça login
            </Link>
          </Typography>
        </Box>
      </StyledForm>

      {/* Footer */}
      <Box sx={{ mt: 4, textAlign: "center" }}>
        <Typography variant="body2" color="textSecondary">
          © 2025 Trinar. Todos os direitos reservados.
        </Typography>
      </Box>
    </StyledContainer>
  );
};

export default Register;
